import React from 'react';
import './Footer.css';

/**
 * React component to create a footer
 * @returns { React.ReactElement } Footer component
 */
function Footer() {
   return (
      <footer className="footer">
         <p className="footer_text">Copyright 2020 Argent Bank</p>
      </footer>
   );
}

export default Footer;
